                    break;
                case "system pagepermissions":
                    CurrentReportSelected = SystemDC.SystemPagePermissions(new DynamicModels.RootReport());
                    break;
                case "system groups":
                    CurrentReportSelected = SystemDC.SystemGroups(new DynamicModels.RootReport());
                    break;
                case "system groupidentities":
