                    break;
                case "system grouproles":
                    CurrentReportSelected = SystemDC.SystemGroupRoles(new DynamicModels.RootReport());
                    break;
                case "system objects":
                    CurrentReportSelected = SystemDC.SystemObjects(new DynamicModels.RootReport());
                    break;
                case "system pages":
                    CurrentReportSelected = SystemDC.SystemPages(new DynamicModels.RootReport());
                    break;
                case "system grips":
                    CurrentReportSelected = SystemDC.SystemGrips(new DynamicModels.RootReport());
                    break;
                case "system objectsets":
                    CurrentReportSelected = SystemDC.SystemObjectSets(new DynamicModels.RootReport());
                    break;
                case "system objectpropsets":
                    CurrentReportSelected = SystemDC.SystemObjectPropSets(new DynamicModels.RootReport());
